        setArtistas(artistas);

        const albuns = JSON.parse(localStorage.getItem('@squadsFy/artista'));
        setAlbuns(albuns);
    }, []);


    return (
        <Header>
            {
                artistas.length > 0 &&
                <Table hover className="historico">
                    <thead>
                        <tr>
                            <th>Artista procurado</th>
                            <th>Data da busca</th>
